import React, { Component } from 'react'
import GitHub from 'github.gif';
export default class Contacts extends Component {
	render() {
		return (
			<main>
				<section className='Contacts'>
					<h1 className='Contacts__h1'>Контакты</h1>
					<div className='Contacts__contacts_info'>
						<a className='contact' href='https://github.com/WE1337834'>
							<img
								width='48'
								height='48'
								src='https://img.icons8.com/color-glass/48/000000/github--v2.png'
								alt='github--v2'
							/>
						</a>
					</div>
				</section>
			</main>
		)
	}
}
